import React from "react";
import SkillsApi from "./skillsapi";
import './skills.css';
import Csskill from "./csskills";
const Skills = () => {

  function csSkills(cueskill){
return (
  <h3 className="csshillh3">{cueskill.name}</h3>
  
);
  };

  function softSkills(curlele){
    return (
    <div className="softskills">{curlele}</div>
    )
  }
  return (
    <div>
      <div className="skills hire-me">
        <h1 className="skills_h1 hire-me_h1 about_des_h1">Skills</h1>
        <h2>Tech Enthusiast & Innovator</h2>
        <div className="skills_cs">
        {Csskill.map(csSkills)}
        </div>
        <div className="skills_soft">
        {SkillsApi.map(softSkills)}

        </div>
      </div>
    </div>
  );
};

export default Skills;
